import React, { useEffect, useState } from "react";
import "../App.css";
import { useNavigate } from "react-router-dom";
import axios from "axios"

const Myprojects = (props) => {
  const userdata={
    "idusers": 3,
    "userName": "amine_slimani",
    "email": "aminslimani76@gmail.com",
    "password": "A.m.i.n.e1",
    "imageUrl": "https://www.instagram.com/p/ChMnZWAtBf2/",
    "githubLink": "https://github.com/slimani-amine"
}
  const navigate = useNavigate();
  const deleteproject = (id) => {
    axios
      .delete(`http://localhost:4000/api/projects/deleteproject/${id}`)
      .then((result) => {
        console.log("deleted");
      })
      .catch(function (error) {
        console.log(error);
      });
  };
  const [data, setData] = useState([]);
  useEffect(() => {
    axios
      .get(`http://localhost:4000/api/projects/byowner/${userdata.idusers}`)
      .then((result) => {
        setData(result.data);
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  return (
    <div className="card-container">
      {data &&
        data.map((e, i) => {
          return (
            <div class="card-client">
              <div class="user-picture">
                <img src={e.sreenshotLink} alt={e.name} />
              </div>
              <p class="name-client"> {e.name}</p>
              <p>{e.description} </p>
              <a href={e.viewlink}> Open the website</a>
              <br />
              <a href={e.githubLinkRepo}>Open repo on github</a>
              
            </div>
          );
        })}
      <button
        className="button"
        onClick={() => {
          navigate("/myprojects/addproject");
        }}
      >
        Add Project
      </button>
    </div>
  );
};




